DROP SCHEMA IF EXISTS Music;
CREATE SCHEMA IF NOT EXISTS Music;
USE Music;

CREATE TABLE tracks (
   id   INT NOT NULL PRIMARY KEY AUTO_INCREMENT, 
   name VARCHAR(100) NOT NULL,
   artist VARCHAR(100),
   album VARCHAR(100),
   duration DOUBLE NOT NULL,
   release_date DATETIME,
   inserted_by VARCHAR(100),
   tribo VARCHAR(100)
);


COMMIT;